script: |
  super -f text -I q10577.spq | sort > q10577.out

inputs:
  - name: q10577.spq
    data: |
      SELECT DISTINCT MAX ( - col0 ) FROM tab1 (FORMAT parquet) WHERE ( ( - 8 ) * - col1 ) NOT BETWEEN + col1 / - col0 AND col0 * - col0;
  - name: tab1

outputs:
  - name: q10577.out
    data: |
      -51
